import "./Banner.scss";
export const Banner = () => {
  return (
    <div className="banner-page">
      <div className="banner-section">
        <h2>Online Store</h2>
        <h5>Buy Anywhere</h5>
        <p>Shop Now</p>
        <img
          alt="search"
          src={require("../../image/dd.png")}
          className="top-image"
        />
        <img
          alt="search"
          src={require("../../image/tt.png")}
          className="down-image"
        />
      </div>
    </div>
  );
};
